import React from 'react';
import { Link } from 'react-router-dom';

import './Button.css'

const Button = ({ text, link, backgroundColor="transparent" }) => {
    return(
        <div>
            <Link to={link} style={{ textDecoration: 'none' }}>
                <div className="button" style={{color: toString(backgroundColor)}} onMouseOver={concat("this.style.backgroundColor=", toString(hoverColor))}>
                    {text}
                </div>
            </Link>
        </div>
    );
}

export default Button;
